import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';


function NavigationItems() {

    return (
        <Container id="navigationItem_Container">
            <Row className="align-items-center">
            <Col>
            <h1>something</h1>
            <p>something else</p>
            </Col>
            </Row> 
        </Container>
      );
}

export default NavigationItems;
